import Funny from "./Funny";
import College from "./College";
import "./ExcusesStyle.css";

export default function Modal({ setModal, setShownFunny, setShownCollege }) {
    console.log(setShownFunny);
    if (setShownFunny) {
        return (
            <div>
                <div className="excuseContainer">
                    <div className="excuseInnerContainer">
                        <button
                            className="closeBtn"
                            onClick={() => setModal(false)}
                        >
                            X
                        </button>
                        <Funny />
                    </div>
                </div>
            </div>
        );
    } else {
        return (
            <div>
                <div className="excuseContainer">
                    <div className="excuseInnerContainer">
                        <button
                            className="closeBtn"
                            onClick={() => setModal(false)}
                        >
                            X
                        </button>
                        <College />
                    </div>
                </div>
            </div>
        );
    }
}
